import React from "react";
import { Button, Input } from "reactstrap";
import { useMainBox } from "../contexts/MainBoxContext";
import ScreenType from "../enuns/ScreenType";
import './../assets/scss/welcome.scss';

const Welcome: React.FC = () => {
  const { setScreen } = useMainBox();
  return (
    <div className={"main"}>
      <img style={{
        position: "absolute",
        zIndex: -10,
        height: 100,
      }} 
      src={require('./../assets/images/decisions.png')} alt={"decisions"}/>
      <div className={"form shadow bg-white rounded"}>
        <div className={"inputs"}>
          <Input style={{}} 
          placeholder="E-mail">
          </Input>
          
          <Input style={{marginTop: 10}} 
          placeholder="Senha"></Input>
        </div>

        <div style={{
          marginTop: 20,
        }} className={"buttons"}>
          <Button color={"primary"} style={{
            width: "100%"
          }}
          onClick={() => setScreen(ScreenType.MINHASCOTACOES)}>
            Entrar
          </Button>
          <Button style={{
            float: "right",
            fontSize: 14  
          }}
            color={"link"}>
            Esqueceu a sua senha?
          </Button>
        </div>
      </div>
    </div>
  );
};

export default Welcome;
